import React from 'react';
import Layout from '../components/MyLayout';
import LikeButton from '../components/LikeButton';
import Dropdown from 'react-bootstrap/Dropdown';
import Table from 'react-bootstrap/Table';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import CustomerJsonData from '../customers-file-map.json';

//Object.keys(CustomerJsonData).map(id => customers[id]);
// var customers = CustomerJsonData.map((item) {
//     return {
//         key: item.id,
//         label: item.name
//     };
// });

//console.log(customers);

class CustomerData extends React.Component {
    render() {
        return(
            <div>
                {this.props.CustomerJsonData.map(e1 => {
                    return(
                        <div key={e1.name}>
                            {e1.name}
                        </div>
                    )
                })}
            </div>
        )
    }
}

export default function Classification() {
    return(
        <Layout>
            <title>Document Classifications by Customer</title>
            <Container>
                <Row>
                    <Col>Document Classifications by Customer</Col>
                </Row>
                <Row>
                    {CustomerJsonData.map(e1 => {
                        return(
                            <div key={e1.name}>
                                {e1.name}
                            </div>
                        )
                    })}
                </Row>
                <Row>
                    <Col>
                        Customer data: 
                    </Col>
                </Row>
                <Row>
                    <Col>
                        <Dropdown>
                            <Dropdown.Toggle variant="sucecss" id="customer-names-dropdown">
                                Customer Names
                            </Dropdown.Toggle>

                            <Dropdown.Menu>
                                <Dropdown.Item as="button">First Customer</Dropdown.Item>
                                <Dropdown.Item as="button">Second Customer</Dropdown.Item>
                                <Dropdown.Divider />
                                <Dropdown.Item as="button">Clear Selected Customers</Dropdown.Item>
                            </Dropdown.Menu>
                        </Dropdown>
                    </Col>
                    <Col>
                    </Col>
                </Row>








                <div>
                    <div>

                    {/* </div>
                    <div class="col-md-1" id="document-types"> */}
                    <Dropdown>
                            <Dropdown.Toggle variant="success" id="document-types-dropdown">
                                Document Types
                            </Dropdown.Toggle>

                            <Dropdown.Menu>
                                <Dropdown.Item as="button">First Document Type</Dropdown.Item>
                                <Dropdown.Item as="button">Second Document Type</Dropdown.Item>
                                <Dropdown.Divider />
                                <Dropdown.Item as="button">Clear Document Types</Dropdown.Item>
                            </Dropdown.Menu>
                        </Dropdown>
                    </div>
                </div>

                <div>
                    <Table striped bordered hover>
                        <thead>
                            <tr>
                                <th>Document Types</th>
                                <th>First Customer</th>
                                <th>Second Customer</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Document A</td>
                                <td>First Customer's Document A</td>
                                <td>Second Customer's Document A</td>
                            </tr>
                            <tr>
                                <td>Document B</td>
                                <td>First Customer's Document B</td>
                                <td>Second Customer's Document B</td>
                            </tr>
                        </tbody>
                    </Table>
                </div>

                <div>
                    <p><LikeButton></LikeButton></p>
                </div>
            </Container>
        </Layout>
    );
};
